import styled from 'styled-components';

const PrettyHome = styled('div')`
    margin: auto;
    /* width: 50%; */
    text-align: center;
    /* height: 100vh; */
    margin-top: 150px;
    border: 1px solid black;
    @media(max-width: 700px) {
        width: 80%;
        margin-top: 20px;
    }
`;
const BootstrapContainer = styled('div')`
    .container {
        padding-right: 15px;
        padding-left: 15px;
        margin-right: auto;
        margin-left: auto;
    }
    @media (min-width: 768px) {
        .container {
            width: 750px;
        }
    }
    @media (min-width: 992px) {
        .container {
            width: 970px;
        }
    }
    @media (min-width: 1200px) {
        .container {
            width: 1170px;
        }
    }
`;

const PlainBox = styled('div')`
    margin: 0 auto;
    width: 50%;
    text-align: center;
    /* height: 100vh; */
    margin-top: 150px;
    border: 1px solid black;
    @media(max-width: 700px) {
        width: 80%;
        margin-top: 20px;
    }
`;

export default { PrettyHome, BootstrapContainer, PlainBox };
